  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {
    wx.getStorage({
      key: 'openID',
      success: (res) => {
        console.log("查询本地openID结果：", res.data);
        DB.where({
          _openid:res.data
        }).get({
          success: (res) => {
            console.log("数据库查询数据", res.data);
            this.setData({
              listItem: res.data,
            });
            console.log("加载后数据：", this.data.listItem);
          },
        });
      },
    })
  
  },

